Lonely Planet Egypt is your passport to the most relevant, up-to-date advice on what to see and skip, and what hidden discoveries await you.

Visit the ancient wonders of the Pyramids of Giza, cruise the Nile to a waterside temple, or see the glittering finds in the Egyptian Museum; all with your trusted travel companion. Get to the heart of Egypt and begin your journey now!
